// Header.js

import React from 'react'
import { Link } from 'react-router-dom';
import Navbar from 'react-bootstrap/Navbar';
import Nav from 'react-bootstrap/Nav';
import NavDropdown from 'react-bootstrap/NavDropdown';

function Header() {
    return (
        <div className="headerContainer">
            <div className="mainPageHeaderItem">
                    <img src={require('../pet-recs-logo_low-qual.png')} width='48' height='55' />
                    PetRecs
                </div>

                <div className="mainPageHeaderItem push-right">
                    <Link to="/register">
                        <button className="btn-homepage-header btn-homepage-header-register">
                            Create an Account
                        </button>
                    </Link>
                    <Link to="/login">
                        <button className="btn-homepage-header">
                            Log In
                        </button>
                    </Link>
                </div>
        </div>
    )
}

export default Header
